import React from 'react';
import {Image} from 'semantic-ui-react';

function App() {
  return (
    <div className="App">

      <div className='searchInput'>
      <Input icon={{ name: 'search', circular: true, link: true }} placeholder='Search...' />
      </div>
    </div>
  );
}

export default App;
